import React from 'react';
import { Box, Typography } from '@mui/material';

const HelloWorldApp = () => {
  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
      }}
    >
      <Typography variant="h4">Hello, world!</Typography>
    </Box>
  );
};

export default HelloWorldApp;
